        /// <summary>
        /// 循环数据采集
        /// </summary>
        private void Th_CycleDataAcq2()
        {
            trs[1].Tick += (sender, e) =>
            {
                int l = glb.SimpLanRecord();

                try
                {
                    byte[] buffReceTotal = new byte[449];

                    byte[] buffSenda = { 0x00, 0x00, 0x00, 0x00, 0x00, 0x06, 0x01, 0x03, 0x00, 0x00, 0x00, 0x7b };
                    byte[] buffRecea = new byte[255];

                    sockets[1].Send(buffSenda, buffSenda.Length, 0);
                    sockets[1].Receive(buffRecea, buffRecea.Length, 0);

                    if (buffRecea[0] == 0 && buffRecea[1] == 0 && buffRecea[2] == 0 && buffRecea[3] == 0 && buffRecea[4] == 0
                     && buffRecea[5] == 249 && buffRecea[6] == 1 && buffRecea[7] == 3 && buffRecea[8] == 246
                     && buffRecea[9] == 0 && buffRecea[10] == 0 && buffRecea[11] == 0 && buffRecea[12] == 2)
                    {
                        byte[] buffSendb = { 0x00, 0x00, 0x00, 0x00, 0x00, 0x06, 0x01, 0x03, 0x00, 0x7b, 0x00, 0x61 };
                        byte[] buffReceb = new byte[203];

                        sockets[1].Send(buffSendb, buffSendb.Length, 0);
                        sockets[1].Receive(buffReceb, buffReceb.Length, 0);

                        if (buffReceb[0] == 0 && buffReceb[1] == 0 && buffReceb[2] == 0 && buffReceb[3] == 0 && buffReceb[4] == 0
                         && buffReceb[5] == 197 && buffReceb[6] == 1 && buffReceb[7] == 3 && buffReceb[8] == 194
                         && buffReceb[9] == 0 && buffReceb[10] == 0 && buffReceb[11] == 0 && buffReceb[12] == 0)
                        {
                            //拼接比特字节
                            for (int i = 0; i < buffRecea.Length; i++)
                            {
                                buffReceTotal[i] = buffRecea[i];
                            }
                            for (int i = 0; i < buffReceb.Length - 9; i++)
                            {
                                buffReceTotal[255 + i] = buffRecea[9 + i];
                            }

                            //数据解析

                            //32 * 布尔值
                            byte[] bs_boolValStr1 = { buffReceTotal[13], buffReceTotal[14] };
                            byte[] bs_boolValStr2 = { buffReceTotal[15], buffReceTotal[16] };
                            string boolValStr = mod.ByteToBinStr(bs_boolValStr1) + mod.ByteToBinStr(bs_boolValStr2);
                            for (int i = 0; i < 32; i++)
                            {
                                if (boolValStr.Substring(i, 1) == "0")
                                {
                                    regval2s[i] = "false";
                                }
                                else
                                {
                                    regval2s[i] = "true";
                                }
                            }

                            //26 * 整型值
                            for (int i = 0; i < 26; i++)
                            {
                                byte[] bs_intValStr = { buffReceTotal[17 + 2 * i], buffReceTotal[18 + 2 * i] };
                                regval2s[32 + i] = mod.ByteToDecStr(bs_intValStr);
                            }

                            //95 * 浮点值
                            for (int i = 0; i < 95; i++)
                            {
                                byte[] bs_floatValStr = { buffReceTotal[69 + 4 * i], buffReceTotal[70 + 4 * i], buffReceTotal[71 + 4 * i], buffReceTotal[72 + 4 * i] };
                                regval2s[58 + i] = mod.ByteToFloatStr(bs_floatValStr);
